9027e9a7-fe45-452c-9442-e0b54cb5af12=In this application, employees can request reimbursements for expenses they make on behalf of the company. When one of your employees logs a new expense, managers will automatically get a task in their task inbox asking for approval. If a manager approves the request, but the amount is too high, the expense needs a finance controller to sign off on it as well. Administrators can track statistics about expense requests and make changes or intervene when necessary.
2a94331a-416c-464e-b8a8-a5727231629c=
21087dbf-13da-4a29-bf87-7fbb3f4d806e=You can use the demo user switcher, indicated by the user icon on the right side of the screen, to switch to the viewpoint of a specific role. Start by selecting the "demo_employee" role and create a new expense. A task will automatically be created for the managers to approve it. Using the demo switcher again, you can switch to "demo_manager" to see the task in the task inbox, and from there execute it. If you log an expense for an amount of 1000 or higher, and the manager approves, you can switch to "demo_finance_controller" to see that the request made it into their inbox as well. Finally, once you have gone through a couple expenses, try out the "demo_administrator" role to see statistics on the expense requests and the management options that are available to them.
