8f969610-e383-4192-8b1e-8e5ac367e8f6=Readme\r\n\=\=\=\=\=\=\=\=\=\=\=\=\=\r\n\r\nHow to configure\r\n--------------------------------------\r\nDo not modify this module instead\:\r\n1. Create a custom module\r\n2. Copy pages/microflows from this module to a custom module and/or reuse snippets/microflows.\r\n\r\nQuick start\:\r\n- Add MonitoringDashboard and ProcessedTasks pages to your navigation.\r\n- Modify the constants 'TasksCompletedOlderThanHours' & 'TasksNonCompletedOlderThanHours' as per the requirement on when to clean up the ProcessedTasks.\r\n- Enable the SE_CleanupTaskQueue scheduled event if automatic cleanup is desired. Note that as of Mendix 9.9 this can be set using the com.mendix.core.ProcessedTasksCleanupAge runtime setting.\r\n\r\nNOTE\: Triggering the Microflow 'RetrieveQueueCounts' and Java action 'GetQueueCounts' often may degrade the performance of the queues.
